import React from "react";

export default function Display() {
	return (
		<>
			<div className="tw-bg-blue-500 tw-text-white tw-p-4">Hello</div>
			<button className="bg-sky-600 focus:outline-none focus:ring  focus:ring-sky-600 hover:bg-sky-800 active:bg-slate-500 rounded-2xl border-spacing-3 p-2">
				Button
			</button>
			<div className=" will-change-auto md:will-change-scroll">
				<iframe
					src="https://packaged-media.redd.it/j3r28b7vjnp91/pb/m2-res_1080p.mp4?m=DASHPlaylist.mpd&v=1&e=1707782400&s=105d131c2c6068857e42344827a2c8cda52a7207#t=0"
					frameborder="0"
					className="w-full aspect-video scrol will-change-scroll"
				></iframe>
			</div>
		</>
	);
}
